import React from 'react';
import { NavLink } from 'react-router-dom';

const NavbarLinks = () => {
  return (
    <>
      <NavLink to='/'> ΑΡΧΙΚΗ </NavLink>
      <NavLink to='/staffs'> ΠΡΟΣΩΠΙΚΟ </NavLink>
      <NavLink to='/homes'> ΟΙΚΗΜΑΤΑ </NavLink>
      <NavLink to='/requests'> ΑΙΤΗΣΕΙΣ </NavLink>
    </>
  )
}

export default NavbarLinks;
